import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import './Navigation.css'
import logoHome from "../images/mepelaozen.png"
import whatsapp from "../images/whatsapp.png"
import facebook from "../images/facebook.png"
import instagram from "../images/instagram.png"
import { useDispatch, useSelector } from 'react-redux'
import styled from 'styled-components'
import { logoutUser } from '../store/AuthSlice'
import { toast } from 'react-toastify'
import {AiOutlineClose,AiOutlineMenu} from 'react-icons/ai'


function Navigation() {

  const dispatch = useDispatch()

  const [nav,setNav] = useState(false)

  const handleNav =()=>{
    setNav(!nav)
  }


  const {cartTotalQuantity} = useSelector((state)=>state.cart)
  const auth = useSelector((state)=>state.auth)

  return (
    <div className='flex'>

      <Link className=' items-center' to="/home"><img src={logoHome} alt="לוגו למסך הבית" width="180px"/></Link>

      <ul>
        <li>   <Link to="/cart"><svg xmlns="http://www.w3.org/2000/svg" width="35" height="35" fill="currentColor" className="bi bi-handbag-fill" viewBox="0 0 16 16">
          <path d="M8 1a2 2 0 0 0-2 2v2H5V3a3 3 0 1 1 6 0v2h-1V3a2 2 0 0 0-2-2zM5 5H3.36a1.5 1.5 0 0 0-1.483 1.277L.85 13.13A2.5 2.5 0 0 0 3.322 16h9.355a2.5 2.5 0 0 0 2.473-2.87l-1.028-6.853A1.5 1.5 0 0 0 12.64 5H11v1.5a.5.5 0 0 1-1 0V5H6v1.5a.5.5 0 0 1-1 0V5z"/>
        </svg> 
        <span>{cartTotalQuantity}</span>
        </Link></li>


        <li>   
           <Link to="/case" className="p-4">אביזרים</Link>
        </li>


        <li> 
             <Link to="/samsung" className="p-4" >Samsung</Link>
        </li>


        <li>
        <Link to="/airpods" className="p-4">AirPods</Link>
        </li>


        <li>
        <Link to="/iphone" className="p-4" >Iphone</Link>
        </li>


        <li>
        <Link to="/ipad"  className="p-4">Ipad</Link>
        </li>


        <li>
        <Link to="/watch"  className="p-4">Watch</Link>
        </li>


        <li>
        <Link to="/mac"  className="p-4">Mac</Link>
        </li>


      </ul>
        </div>



  )
}

export default Navigation

// const Logout = styled.div`
//   color: black;
//   cursor: pointer;
// `


const AuthLinks = styled.div`
display: flex;
justify-content: end;
margin-right: 2rem;

  a{
    &:last-child{
      margin-left: 2rem;
    }
  }
`


const Links = styled.div`
  display: flex;
  div{
    cursor: pointer;
    &:last-child{
      margin-left: 2rem;
    }
  }
`
